define( [
	'../../../../bower_components/underscore/underscore',
	'backbone',
	'i18next',
	'config'
], function( _, Backbone, i18next, Config ){
    var SaveReviewModel = Backbone.Model.extend( {
			instructorId: null,
			url: function() {
				return Config.apiURL + '/instructors/' + this.instructorId + '/reviews';
			}
    } );

    return SaveReviewModel;
});
